import Link from "next/link";

const FullMenu = ({ menuVisible }) => {
  return (
    <div className={`fullcreen-menu ${menuVisible ? "visible" : ""}`}>
      <nav className="menu-nav">
        <Link href="/">
          <ion-icon name="home"></ion-icon>
          <a>Home</a>
        </Link>
      </nav>
    </div>
  );
};

export default FullMenu;
